webpackJsonp([0xa25354d9ba9e],{5944:function(e,t){e.exports={data:{post:{html:'<p>According to <a title="Burningbird: Two years of weblogging" href="http://weblog.burningbird.net/fires/001022.htm">Burningbird</a>, a link to PapaScott was shown on the NBC Nightly News. They did a piece on warblogs and showed a <a href="http://www.google.com/search?q=warblogs">Google search</a> where a <a href="/2003/02/11/2098.php">PapaScott page</a> is entry number 3. </p>\n<p>Who cares that my paper on warblogs wasn\'t accepted for the <a href="http://www.blogtalk.net/">BlogTalk conference</a>. I was on TV! Did I look good? Did my hair look alright? Is this something I can put on my resum√©?</p>',fields:{title:"I Was On TV!",date:"29 Mar 2003",url:"https://papascott.de/2003-03-29-i-was-on-tv/"}}},pathContext:{slug:"/2003-03-29-i-was-on-tv/",prev:{fields:{title:"Der Brand: Weapon, Strategy",date:"27 Mar 2003",slug:"/2003-03-27-der-brand-weapon-strategy/"}},next:{fields:{title:"Children's Stories",date:"30 Mar 2003",slug:"/2003-03-30-childrens-stories/"}}}}}});
